function processLocation(arr) {
  if (arr.length > 0) {
    const firstElement = arr[0];
    const parts = firstElement.split(",");
    const lastPart = parts[parts.length - 1].trim();

    if (!arr.includes(lastPart)) {
      arr.push(lastPart);
    }
  }
  return arr;
}
